      //   console.log(jsonData)
      // })
      // .catch((error) => {
      //   // handle your errors here
      //   console.error(error)
      // })

  }

  render(){
    if (this.state.isLoading) {
      return <p>Loading...</p>;
    }else{
      return <div>
      <table>
        <tr>
          <th>
            {this.data}
          </th>
        </tr>
      </table>
      </div>
    }
  }

}
export default App;
